import './App.css';

function App() {
  return (
    <div className="App" id="quote-box">
      <p id="text" >
        [Quote Text here]
      </p>

      <h6 id="author">
        [Author Name here]
      </h6>

      <button id="new-quote">New Quote</button>

      <a href="#" target="_blank"></a>
    </div>
  );
}

export default App;
